import React, {Component, Fragment} from 'react';
import {Navigate} from '../App';
import {
    Typography,
    Button,
    List,
    ListItem,
    ListItemText
} from '@material-ui/core';
import logo from '../goodness.png';

interface HomeScreenProps {
    navigate: Navigate;
    challenges: string[];
}

interface HomeScreenState {}

export class HomeScreen extends Component<HomeScreenProps, HomeScreenState> {
    constructor(props: HomeScreenProps) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <Fragment>
                <div
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent: 'space-between',
                        padding: '2ch'
                    }}
                >
                    <img src={logo} style={{width: '20ch'}} />
                    <Button onClick={() => this.props.navigate('DailyCheckIn')}>
                        Daily Check In
                    </Button>
                </div>
                <Typography variant='h5'>Today's Challenges</Typography>
                <List dense>
                    {this.props.challenges.map(challenge => (
                        <ListItem button>
                            <ListItemText>{challenge}</ListItemText>
                        </ListItem>
                    ))}
                </List>
            </Fragment>
        );
    }
}
